// ScrollSpyComponent.js
import React from 'react';
import Scrollspy from 'react-scrollspy';
import Nav from 'react-bootstrap/Nav';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

const ScrollSpy1 = () => {
  return (     
      <Nav className='pt-3 ' >
        <Scrollspy 
          items={['section1', 'section2', 'section3', 'section4', 'section5']}
          currentClassName="active" 
        >
          <Nav.Item >
             <Nav.Link href="#section1"><h4>Home</h4></Nav.Link>
         </Nav.Item>
         <Nav.Item >
              <Nav.Link href="#section2"><h4>About Us</h4></Nav.Link>
         </Nav.Item>
         <Nav.Item >
             <Nav.Link href="#section3"><h4>Services</h4></Nav.Link>
         </Nav.Item>
         <Nav.Item>
             <Nav.Link href="section4"> <h4>managment</h4></Nav.Link>
         </Nav.Item>
         <Nav.Item>
             <Nav.Link href="section5"> <h4>Contact Us</h4></Nav.Link>
         </Nav.Item>
        </Scrollspy>
      </Nav>
  );
};

export default ScrollSpy1;
